      }
    }
  }
  return (
    <div className={[classes.root && "dashbord"]}>
      <Grid
        container
        spacing={2}
        direction="column"
        justify="flex-start"
        alignItems="stretch"
      >
        <Grid item xs={12} className="answer">
          <div></div>
          <div></div>
        </Grid>
        <Grid
          item
          xs={12}
          className="literals"
          container
          direction="row"
          justify="flex-start"
          alignItems="flex-start"
        >
          <Grid item xs={2} className="part1">
            <Button onClick={handelClick}>
            +
