            <Button>
              =
            </Button>
          </Grid>
          <Grid item xs={2} className="part1">
            <Button>
              /
            </Button>
            <Button>
              %
            </Button>
            <Button>
            x&sup2;
            </Button>
            <Button>
            &radic;
            </Button>
          </Grid>
          <Grid item xs={8} className="part2">
            <Button>1</Button>
            <Button>2</Button>
